import React, { Component } from 'react';
import CardLancamento from '../card-lancamento';
import "./style.css";
class Lista extends Component {

    render() {
        return (

            <ul>{this.props.lancamentos.map((dia,  lancamentos, index) => {
              return (
                <li key={index}>
                    <div>{dia}</div>
                    <CardLancamento/>
                </li>
              );  
            })}</ul>
        );
    }
}

export default Lista;
